import React from 'react';

import './Sidebar.css';
import Profile from '../Profile/Profile';

class Sidebar extends React.Component {
    render() {
        return (
            <div class="sidebar">
                <ul>
                    <li>Test 1</li>
                    <li>Test 2</li>
                    <li>Test 3</li>
                </ul>
            </div>
        );
    }
}

export default Sidebar;
